import React, { useState, useEffect } from 'react';
import axios from 'axios';
import { useNavigate } from 'react-router-dom';
function Suggestions() { // Component name matches PascalCase convention
  const [suggestions, setSuggestions] = useState([]);
  const [regimeAnalysis, setRegimeAnalysis] = useState('');
  const [mlPrediction, setMlPrediction] = useState(null);
  const [message, setMessage] = useState('');
  const [loading, setLoading] = useState(true);
  const navigate = useNavigate();

  useEffect(() => {
    const fetchSuggestions = async () => {
      const token = localStorage.getItem('jwt_token');
      if (!token) {
        navigate('/login');
        return;
      }

      const processedData = JSON.parse(localStorage.getItem('processedData'));

      if (!processedData || !processedData.aggregated_financial_data || !processedData.final_tax_computation_summary) {
        setMessage('No processed data found. Please upload documents first.');
        setLoading(false);
        return;
      }

      try {
        const response = await axios.post('http://127.0.0.1:5000/api/get_suggestions', 
          {
            aggregated_financial_data: processedData.aggregated_financial_data,
            final_tax_computation_summary: processedData.final_tax_computation_summary
          },
          {
            headers: {
              'Authorization': `Bearer ${token}`
            }
          }
        );
        setSuggestions(response.data.suggestions_from_gemini || []);
        setRegimeAnalysis(response.data.gemini_regime_analysis || 'No detailed regime analysis.');
        setMlPrediction(response.data.ml_prediction_summary || null);
        setMessage(response.data.message || 'Suggestions loaded.');
      } catch (error) {
        console.error('Error fetching suggestions:', error);
        if (error.response) {
          setMessage(`Error: ${error.response.data.message || 'Server error'}`);
          if (error.response.status === 401) {
            navigate('/login');
          }
        } else {
          setMessage('Error: Could not connect to the server.');
        }
      } finally {
        setLoading(false);
      }
    };

    fetchSuggestions();
  }, [navigate]);

  if (loading) {
    return <div className="suggestions-container">Loading tax suggestions...</div>;
  }

  if (message && message.includes('No processed data found')) {
    return <div className="suggestions-container error-message">{message}</div>;
  }

  return (
    <div className="suggestions-container">
      <h2>Tax Saving Suggestions & Regime Analysis</h2>
      {message && <p className="message">{message}</p>}

      {suggestions.length > 0 && (
        <div className="suggestions-section">
          <h3>AI-Powered Suggestions:</h3>
          <ul>
            {suggestions.map((suggestion, index) => (
              <li key={index}>{suggestion}</li>
            ))}
          </ul>
        </div>
      )}

      {regimeAnalysis && (
        <div className="regime-analysis-section">
          <h3>Tax Regime Analysis:</h3>
          <p>{regimeAnalysis}</p>
        </div>
      )}

      {mlPrediction && (
        <div className="ml-prediction-section">
          <h3>ML-Based Prediction Summary:</h3>
          <p><strong>Predicted Tax Regime:</strong> {mlPrediction.predicted_tax_regime}</p>
          <p><strong>Predicted Tax Liability:</strong> ₹{mlPrediction.predicted_tax_liability.toFixed(2)}</p>
          <p><strong>Predicted Refund Due:</strong> ₹{mlPrediction.predicted_refund_due.toFixed(2)}</p>
          <p><strong>Predicted Additional Due:</strong> ₹{mlPrediction.predicted_additional_due.toFixed(2)}</p>
          <p><em>Notes:</em> {mlPrediction.notes}</p>
        </div>
      )}

      {suggestions.length === 0 && !regimeAnalysis && !mlPrediction && (
        <p>No suggestions or analysis available. Please process documents first.</p>
      )}
    </div>
  );
}

export default Suggestions;
